/** Fade out the button next to the username of the person who asked a question **/
function hide_question_asker(){
	var this_post = $(this);
	$('.asker-ask-link',this_post).fadeOut(500);
}

/** Fade in the "Reply" button in the inbox. **/
function answer_reply_show(){
	var this_post = $(this);
	if($('.replyask',this_post).length == 0 && $('.reply_box_frame',this_post).length == 0){ //Check if we haven't already added the "Reply" button (.replyask), and that the inserted ask box is not present
		//We have not added the Reply button, so we'll create that now.
		newButton = $('<div><div>').addClass('post_control replyask show_label no_icon').attr('title','Reply').html("Reply"); //Create the button
		newButton.click(buttonReply); //Bind the function that will be executed when the user clicks the Reply button. 
		newButton.css("display","none"); //Initially hide the button, so we can have it fade in. 
		$('div.post_controls_inner',this_post).prepend(newButton); //Add the button to the post controls bar.
		$('.replyask',this_post).fadeIn(500); //Fade in
	}
	else{ //The button is already present, but is hidden
		if($('.reply_box_frame',this_post).length === 0){ //Make sure the ask box isn't open
			$('.replyask',this_post).fadeIn(500); //Fade in the button
		}
	}
}

/** Fade out the "Reply" button within the inbox **/
function answer_reply_hide(){
	var this_post = $(this);
	$('.replyask',this_post).fadeOut(500);
}

/** Show the ask box within the inbox when the user clicks the "Reply" button **/
function buttonReply(){
	this.style.display = "none"; //Hide the reply button
	parent = $(this).parent(); //Get the parent element that contains the reply button

	post = $(this).parents("div.post"); //Get the post the user is replying to
	if($('.reply_box_frame',post).length == 0){ //If we haven't added the ask box and it isn't showing.
		link = $("div.post_info a",post).attr("href"); //Get the link to the blog of the person who asked the question
		link = link + "/"; //for some reason the URL in the post info doesn't end in a '/'. That messed up the RegEx. This is a half-assed solution.
		reg = /\/\/([\w-\.]*)\//;
		ahost = reg.exec(link); //Get the host of the asker
		
		username = $("div.post_info a",post).html(); 

		aframe = "http://tumblr.com/ask_form/" + ahost[1];
		var frame = $('<div></div>');
		frame.attr({"class":"reply_box_frame"}).css({"margin-top":"15px","padding-top":"7px","border-top":"1px solid #e7eaec","display":"none"});
		frame.html('<a class="mesreplytitle" href="'+link+'">Reply to '+username+':</a><span class="cancelreply">Close</span><br /><iframe class="mesreply" src="'+aframe+'"></iframe>');
		
		$('div.post_wrapper .post_content',post).after(frame); //Insert the frame within the post
		$("span.cancelreply",post).click(cancelReply); //Add the cancel/close function so the user can change his/her mind.
		
		frame.slideDown(500); //Show the frame
	}
	return false;
}

/** Hide the ask box within the inbox when the user closes/cancels the reply **/
function cancelReply(){
	post = $(this).parents("div.post");
	$("div.reply_box_frame",post).slideUp(500,function(){ $(this).remove(); });
}
	


/** Time to actually start the important stuff **/
function run(){
	$('head').append('<style type="text/css">' + "\n" + TinyboxCss + '\n' + thisCss + '\n</style>'); // Add the stylesheets that we're using to the page
	$('ol#posts').on('mouseenter','a.tumblelog_menu_link.ask:not(.dashplus_ask)',null,avatar_menu_hover); //Binds the avatar_menu_hover() function to be executed whenever someone hovers over the "Ask" button in the avatar dropdown menu
	$('ol#posts').on({'mouseenter':question_asker_ask,'mouseleave':hide_question_asker},'div.post.is_note'); //Binds the functions to show and hide the question mark next to usernames of the person who asked a question. 
	$('ol#posts').on({'mouseenter':answer_reply_show,'mouseleave':answer_reply_hide},'div.post.is_private_answer, div.post.submission'); //binds the functions to show and hide the "Reply" button to messages in the inbox.
}

/** Start the script when the page is done loading.
  * We don't want it to try to change page elements if everything isn't loaded,
  * because then some elements might get left out, leading to errors. **/
$(document).ready(function(){
	run(); 
	// Actually run the script
	// The contents of run() could just go in here, but... yeah. 
});
